import {Input} from "antd";

import "../../../../assets/css/taskSearch.css"

function Search({setSearchKey}) {
    return (
        <div className="search-wrap">
            <Input
                placeholder="Tìm kiếm"
                className="search-element"
                onChange={(e) => {
                    setSearchKey(e.target.value)
                }}
            />
        </div>
    )
}

export default Search;
